import React from 'react';
import { X, Star, MapPin, Clock, DollarSign, GraduationCap, Languages } from 'lucide-react';
import { Doctor } from '../types';

interface DoctorProfileModalProps {
  isOpen: boolean;
  onClose: () => void;
  doctor: Doctor | null;
  onBookAppointment: (doctorId: string) => void;
}

const DoctorProfileModal: React.FC<DoctorProfileModalProps> = ({ 
  isOpen, 
  onClose, 
  doctor, 
  onBookAppointment 
}) => {
  if (!isOpen || !doctor) return null;

  const renderStars = (rating: number) => {
    return Array.from({ length: 5 }, (_, i) => (
      <Star
        key={i}
        className={`h-4 w-4 ${
          i < Math.floor(rating)
            ? 'text-yellow-400 fill-current'
            : 'text-gray-300'
        }`}
      />
    ));
  };

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-6 w-full max-w-2xl max-h-[90vh] overflow-y-auto">
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-2xl font-bold text-gray-900">Doctor Profile</h2>
          <button onClick={onClose} className="text-gray-500 hover:text-gray-700">
            <X className="h-6 w-6" />
          </button>
        </div>

        <div className="flex items-start space-x-6 mb-6">
          <img
            src={doctor.image}
            alt={doctor.name}
            className="w-32 h-32 rounded-full object-cover"
          />
          <div className="flex-1">
            <h3 className="text-2xl font-bold text-gray-900 mb-2">{doctor.name}</h3>
            <p className="text-blue-600 font-semibold text-lg mb-2">{doctor.specialty}</p>
            <p className="text-gray-600 mb-3">{doctor.experience} years of experience</p>

            <div className="flex items-center space-x-2 mb-3">
              {renderStars(doctor.rating)}
              <span className="font-medium text-gray-700">{doctor.rating}</span>
              <span className="text-gray-500">({doctor.reviewCount} reviews)</span>
            </div>

            <div className="flex items-center text-gray-600 mb-2">
              <DollarSign className="h-5 w-5 mr-2" />
              <span className="font-semibold">Consultation Fee: â‚¹{doctor.consultationFee}</span>
            </div>
          </div>
        </div>

        <div className="space-y-6">
          <div>
            <h4 className="text-lg font-semibold text-gray-900 mb-3">About</h4>
            <p className="text-gray-700">{doctor.about}</p>
          </div>

          <div>
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <MapPin className="h-5 w-5 mr-2" />
              Location
            </h4>
            <p className="text-gray-700">{doctor.location.address}</p>
            <p className="text-gray-700">{doctor.location.city}</p>
          </div>

          <div>
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <Clock className="h-5 w-5 mr-2" />
              Availability
            </h4>
            <div className="grid grid-cols-2 gap-2">
              {doctor.availability.map((avail, index) => (
                <div key={index} className="bg-gray-50 p-3 rounded-lg">
                  <p className="font-medium text-gray-900">{avail.day}</p>
                  <p className="text-sm text-gray-600">{avail.startTime} - {avail.endTime}</p>
                </div>
              ))}
            </div>
          </div>

          <div>
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <GraduationCap className="h-5 w-5 mr-2" />
              Education
            </h4>
            <ul className="space-y-2">
              {doctor.education.map((edu, index) => (
                <li key={index} className="text-gray-700 flex items-start">
                  <span className="w-2 h-2 bg-blue-600 rounded-full mt-2 mr-3 flex-shrink-0"></span>
                  {edu}
                </li>
              ))}
            </ul>
          </div>

          <div>
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <Languages className="h-5 w-5 mr-2" />
              Languages
            </h4>
            <div className="flex flex-wrap gap-2">
              {doctor.languages.map((lang, index) => (
                <span
                  key={index}
                  className="bg-blue-100 text-blue-800 px-3 py-1 rounded-full text-sm"
                >
                  {lang}
                </span>
              ))}
            </div>
          </div>
        </div>

        <div className="mt-8 flex space-x-3">
          <button
            onClick={() => {
              onBookAppointment(doctor._id);
              onClose();
            }}
            className="flex-1 bg-blue-600 text-white px-6 py-3 rounded-lg font-medium hover:bg-blue-700 transition-colors"
          >
            Book Appointment
          </button>
          <button
            onClick={onClose}
            className="px-6 py-3 border border-gray-300 text-gray-700 rounded-lg font-medium hover:bg-gray-50 transition-colors"
          >
            Close
          </button>
        </div>
      </div>
    </div>
  );
};

export default DoctorProfileModal;
